package compiler;

import java.io.BufferedReader;
import java.io.File;
import java.io.InputStreamReader;

public class Compiler {
	static final String CC = "gcc";
	static final String FLAGS = "-pthread";
	static final String EXEC_NAME = "wrappedStudentCode";

	private static String objFilename(String filename) {
		return filename + main.Main.WRAPPER_FILE_SUFFIX + ".o";
	}

	private static int execute(String command) throws Exception{
		System.out.println("Executing: " + command);

		Process process = Runtime.getRuntime().exec(command);

		BufferedReader reader = new BufferedReader(new InputStreamReader(process.getErrorStream()));
	    String line;
	    while ((line = reader.readLine()) != null) {
	        System.out.println(line);
	    }
	    System.out.println();

	    reader.close();

		return process.waitFor();
	}

	public static int compileWrapper(String filename) throws Exception {
		String objFile = objFilename(filename);
		String cFile = filename + main.Main.WRAPPER_FILE_SUFFIX + ".c";

		String command = CC + " -c " + FLAGS + " " + cFile + " -o " + objFile;

		return execute(command);
	}

	public static int compileStudentCode(String studentDir, String wrapperFilename) throws Exception {
		File dir = new File(studentDir);

		StringBuilder sb = new StringBuilder();

		for(String filename: dir.list()) {
			if(filename.endsWith(".c")) {
				sb.append(studentDir);
				sb.append("/");
				sb.append(filename);
				sb.append(" ");
			}
		}

		String command = 
						CC + " " + FLAGS + " "
						+ objFilename(wrapperFilename) + " " 
						+ sb.toString()
						+ "-o " + EXEC_NAME;

		return execute(command);
	}
}

