package parser;

import java.io.File;
import java.util.Scanner;

public class Parser {
	private String filename;

	public Parser(String filename) {
		this.filename = filename;
	}

	// imports
	// functions

	public Wrapper parse() throws Exception {
		File file = new File(filename);
		Scanner scanner = new Scanner(file);

		Wrapper wrapper = new Wrapper();

		while(scanner.hasNextLine()) {
			String line = scanner.nextLine();
			if(line.startsWith("//") || line.isBlank()) continue;

			if(line.startsWith("#include")) {
				wrapper.imports.add(line);
			} else {
				wrapper.functions.add(new Function(line));
			}
		}

		scanner.close();

		return wrapper;
	}
}

package main;

import java.util.Scanner;

import compiler.CompilerHelper;
import compiler.DockerHelper;
import parser.Parser;
import parser.Wrapper;

public class Main {
	public static final String WRAPPER_FILE_SUFFIX = "-wrapper";

	public static void main(String[] args) {
		try {
			DockerHelper.startContainer();

			Scanner scanner = new Scanner(System.in);
			System.out.print("Enter config file location: ");
			String filename = scanner.nextLine();

			Parser parser = new Parser(filename);

			Wrapper wrapper = parser.parse();
			wrapper.toFile(filename);

			CompilerHelper.compileWrapper(filename);

			System.out.print("Enter student code directory: ");
			String studentDir = scanner.nextLine();

			CompilerHelper.compileStudentCode(studentDir, filename);

			scanner.close();

		} catch (Exception e) {
			e.printStackTrace();
		}
	}
}

